import React, { Component } from "react";
import Grid from '@material-ui/core/Grid';

import "./App.css";

class DraftingPage extends Component {
  state = {
    draftedPlayers: ["Lebrom James", "Stephen Curry", "Jimmy Butler", "Kemba Walker", "Luka Doncic", "Lou Williams", "James Harden", "Kyrie Irving"],
    playerLists: [],
  };

  componentDidMount() {
    // axios.get("http://127.0.0.1:5000/").then(res => {
    //   this.setState({
    //     data: res.data
    //   });
    // });

    let playerLists = [];
    this.state.draftedPlayers.forEach(player => {
      playerLists.push(<p>{player}</p>)
    });

    this.setState({
      draftedPlayers: playerLists,
    })
  }

  render() {
    return (
      <div>
        <header className="Logo">
          <img src={process.env.PUBLIC_URL + '/NBA.jpg'} alt="logo" style={{ width: 570, height: 375 }} />
        </header>
        <Grid className="DraftingPage">
          <p className="title">Drafting</p>
          <p className="username">{this.props.userName}</p>
          <p>Players</p>
        </Grid>
        <Grid>
          <div>Currently Drafted</div>
          <div className="Playerlist">{this.state.draftedPlayers}</div>
        </Grid>
      </div>
    );
  }
}

export default DraftingPage;
